import Pokemon from './Pokemon'

function Pokemons({ pokemons }) {
  return (
    <article>
      <section>
        {pokemons?.length > 0 ? pokemons.map((pokemon) => <Pokemon />) : null}
      </section>{' '}
    </article>
  )
}

export default Pokemons
